import React, { useEffect } from "react";
import "./About.css";
import Navbar from "./Navbar";
import heroImage from "/Users/aniruddhkapileshwari/Desktop/Deepa-pot/deepa-portfolio/src/assets/5.png"; // Update the path as needed
import gsap from "gsap";

const About = () => {
  useEffect(() => {
    // Animation for the hero section
    gsap.from(".about-header-content", {
      opacity: 0,
      y: 50,
      duration: 1.5,
      ease: "power2.out",
    });
  }, []);

  const deepaData = {
    introduction: `
      Hi, I am a licensed architect with a passion for creating meaningful
      architectural solutions. I believe in harmony between context, built
      form, and users, and my research delves into how space impacts human
      behavior and mental well-being.
    `,
    experience: [
      "NASA India: Design and Editorial Team (2020 - 2021)",
      "Statice Media: Graphic Designer (2021)",
      "Crest Architects: Intern Architect (2022 - 2023)",
    ],
    education: [
      "Vidhya Vardhaka Sangha, Bengaluru (Grade 10, 2004 - 2016)",
      "KLE Society’s S Nijalingappa College, Bengaluru (Grade 11-12, 2016 - 2018)",
      "School of Architecture, Ramaiah Institute of Technology (Bachelors in Architecture, 2018 - 2023)",
    ],
    skills: [
      "AutoCAD",
      "SketchUp",
      "Adobe Photoshop, Illustrator, and InDesign",
      "Model Making",
      "Motion Graphics",
    ],
    languages: ["Kannada", "English", "Hindi"],
    achievements: [
      "Design Head, ANDC 2022 (Shortlisted Top 24)",
      "Assistant Design Head, ANDC 2020 (Shortlisted Top 40%)",
      "Trophy Co-ordinator at INSPIRIT’20 and INSPIRIT’22",
    ],
  };

  return (
    <>
      <header className="about-header">
        <Navbar />
        <div
          className="about-header-background"
          style={{
            backgroundImage: `url(${heroImage})`,
          }}
        ></div>
        <div className="about-header-content">
          <p className="about-header-intro">Hi, I'M </p>
          <h1 className="about-header-name">Deepa Devangmath</h1>
        </div>
      </header>

      <main className="about-main">
        <section className="about-intro">
          <h2>Introduction</h2>
          <p>{deepaData.introduction}</p>
        </section>

        <section className="about-details">
          <h2>More about me</h2>

          <div className="about-detail-block">
            <h3>Work Experience</h3>
            <ul>
              {deepaData.experience.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </div>

          <div className="about-detail-block">
            <h3>Education</h3>
            <ul>
              {deepaData.education.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </div>

          <div className="about-detail-block">
            <h3>Skills</h3>
            <ul>
              {deepaData.skills.map((skill, index) => (
                <li key={index}>{skill}</li>
              ))}
            </ul>
          </div>

          <div className="about-detail-block">
            <h3>Languages</h3>
            <ul>
              {deepaData.languages.map((language, index) => (
                <li key={index}>{language}</li>
              ))}
            </ul>
          </div>

          <div className="about-detail-block">
            <h3>Achievements</h3>
            <ul>
              {deepaData.achievements.map((achievement, index) => (
                <li key={index}>{achievement}</li>
              ))}
            </ul>
          </div>
        </section>
      </main>
    </>
  );
};

export default About;
